import React, { useContext } from 'react'
import { Link } from 'react-router-dom'
import { ContextGlobal } from './utils/global.context'

//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context

const Navbar = () => {
  const {handleChangeTheme, theme} = useContext(ContextGlobal)
  return (
    <nav>
      <ul>
      <li><Link to="/home" className="nav-link">Home</Link></li>
<li><Link to="/dentist/1" className="nav-link">Detalle Dentista</Link></li>
<li><Link to="/contacto" className="nav-link">Contacto</Link></li>
<li><Link to="/favs" className="nav-link">Favoritos</Link></li>

      </ul>
      {/* Aqui deberan agregar los links correspondientes a las rutas definidas */}
      {/* Deberan implementar ademas la logica para cambiar de Theme con el button */}

      <button 
      onClick={handleChangeTheme}
      style={{background: theme.background, color:theme.font}}>
      Change Theme
      </button>
    </nav>
  )
}

export default Navbar
